webpackJsonp([76595816890068],{410:function(e,A){e.exports={data:{site:{siteMetadata:{title:"Laura Domine",subtitle:"Physics Ph.D. student",copyright:"Powered by Gatsby. ¬© All rights reserved.",author:{name:"Laura Domine",twitter:"#"}}},markdownRemark:{id:"/home/mai-hien/hummingbird2/src/pages/projects/2018-06-30--cloud/index.md absPath of file >>> MarkdownRemark",html:'<p><em>Apr. 2018 - ongoing</em></p>\n<p>Won Best Solo prize and Best Satellogic data use at <a href="https://bigearthhacks.stanford.edu/">Stanford Big Earth Hackathon</a>.</p>\n<p>Satellite imagery can be used to monitor the environment or predict disasters and enable quick responses. Clouds bring uneven illumination, blurring and occlusion of the target. Satellite images are traditionally multispectral, i.e. include only a few wavelengths. Hyperspectral images include numerous wavelengths, including near-infrared, and are becoming more widely available. Finally, Generative Adversarial Networks (GANs) are among the most successful unsupervised techniques for generating realistic images by training 2 networks in competition (generator vs discriminator).</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/lakeeriebloom_800-055392ce0a406ce13ac9ec194ea6fa3a-00f86.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image Credit:\nNASA Goddard Space Flight Center"\n        title=""\n        src="/static/lakeeriebloom_800-055392ce0a406ce13ac9ec194ea6fa3a-00f86.jpg"\n        srcset="/static/lakeeriebloom_800-055392ce0a406ce13ac9ec194ea6fa3a-6a66e.jpg 240w,\n/static/lakeeriebloom_800-055392ce0a406ce13ac9ec194ea6fa3a-bc76f.jpg 480w,\n/static/lakeeriebloom_800-055392ce0a406ce13ac9ec194ea6fa3a-00f86.jpg 800w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Image Credit:\nNASA Goddard Space Flight Center</em></p>\n<p>I proposed to apply GANs to hyperspectral satellite images in order to generate the missing patches from below the clouds. I devised and implemented the whole data pre-processing pipeline which includes classifying satellite images patches as cloudy/clear and synthesizing cloud masks.</p>\n<p><a href="https://devpost.com/software/kumo-san">DevPost</a> -\n<a href="http://stanford.edu/~ldomine/ICME_LDomine.pdf">Invited poster at ICME Xpo 2018</a></p>\n<blockquote class="twitter-tweet" data-lang="en-gb"><p lang="en" dir="ltr">Congratulations to Laura, who won 2! awards at <a href="https://twitter.com/Stanford?ref_src=twsrc%5Etfw">@Stanford</a> <a href="https://twitter.com/hashtag/BigEarthHacks?src=hash&amp;ref_src=twsrc%5Etfw">#BigEarthHacks</a>: best solo team &amp; best <a href="https://twitter.com/Satellogic?ref_src=twsrc%5Etfw">@Satellogic</a> use üëè‚ô•Ô∏èüë©‚Äçüíª. Prize includes tasking our satellites to her favorite spot. Her work:  <a href="https://t.co/nJ9CYceZBW">https://t.co/nJ9CYceZBW</a> <a href="https://t.co/sgDdnqME2x">pic.twitter.com/sgDdnqME2x</a></p>&mdash; Bruno S√°nchez-Andrade Nu√±o (@brunosan) <a href="https://twitter.com/brunosan/status/985694650231996416?ref_src=twsrc%5Etfw">16 April 2018</a></blockquote>\n<script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>',fields:{tagSlugs:null},frontmatter:{title:"Cloud Removal in Hyperspectral Satellite Images using Generative Adversarial Networks",tags:null,date:"2018-06-30",description:"Won Best Solo prize and Best Satellogic data use at Stanford Big Earth Hackathon. I proposed to apply GANs to hyperspectral satellite images in order to generate the missing patches from below the clouds."}}},pathContext:{slug:"/projects/cloud"}}}});
